import React from 'react';
import './Expense.css';


function Expenses(props){
    
    return(
       <div>
            
    <div className="expense-item__description">
      <h2>{props.title}</h2>
    </div>
    <div className="expense-item__price">${props.amount}</div> 
    </div>
     
    );
}

export default Expenses;
